import { StrictMode } from "react";
import ReactDOM from "react-dom";

import "./index.css";
import App from "./App";
import FormBuilder from "./components/FromBuilder/FromBuilder";
import { AuthContextProvider } from "./store/auth-context";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <StrictMode>
    <AuthContextProvider>
      <FormBuilder />
    </AuthContextProvider>
  </StrictMode>,
  rootElement
);
